INSERT INTO `genericUser_announcement` VALUES (2,'雲端千眼線上校對志工說明文件','<p><iframe src=\"https://www.youtube.com/embed/nlbI6mOXrp4\" width=\"854\" height=\"480\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>&nbsp;</p>\n<p>各位志工朋友，讓我們一起在雲端上相會哦！（<a href=\"../\" target=\"_blank\" rel=\"noopener\">https://www.edocumentservice.org/</a>）</p>\n<p>需要服務時數、想貢獻自己一份力量的各位志工們，雲端千眼線上校對工作是一個不限時間、不限地點都能夠投入的志願服務工作，只要您上網註冊後，就能夠以志工的身份領取書籍進行校對，想要詳細的瞭解更多資訊嗎？快點下載雲端千眼線上校對說明文件吧！</p>\n<p>雲端千眼線上校對說明文件：<a href=\"https://drive.google.com/file/d/0B64Dl4rrX8UeTEFmZEg2b18yS1E/view?usp=sharing\" target=\"_blank\" rel=\"noopener\">點此下載</a></p>\n<p>Tips：服務時數是由系統偵側您的校對工作情形並自動累積（登入時數不代表服務時數哦），每份文件（50頁）領取後需於五天內校對完畢，超過時限文件將會自動收回並將時數累計給最後完成的人員。</p>','2017-11-03','志工快訊'),(3,'歡迎一起加入雲端千眼平台','<p>各位平台使用者大家好</p>\n<p>這裡是一個致力於閱讀平權推廣的平台，我們希望透過雲端上所有志工的協助，能夠<strong><span style=\"color: #ff6600;\">穩定且客製化</span></strong>的提供視障者想要閱讀的書籍電子檔。十分感謝投入在線上校對的志工們，也鼓勵每一位視覺障礙者來使用並珍惜平台的資源，為保護著作權人的權益，目前平台上所有重製完成的書籍，僅限提供給領有視覺障礙手冊的身心障礙者閱讀，因此是不能將下載的書籍流通轉載哦！平台會持續努力針對平台操作界面和功能進行改善和優化，也希望大家都能夠多多支持嚕！</p>\n<p>如果在平台操作上有任何的問題或建議，都歡迎直接來電（02-27177722#20）或來信（a9203045@forblind.org.tw）詢問，另外在平台頁面的右下角也有一個<span style=\"color: #0000ff;\"><strong>網路客服系統</strong></span>，當顯示線上時可直接與服務人員交談詢問，或是於離線時留言，我們都會儘快回覆或與您聯繫。</p>\n<p style=\"text-align: right;\">雲端千眼服務團隊&nbsp; 謹致</p>','2017-10-25','平台消息'),(5,'全台唯一隱藏著神秘訊息的《點字桌曆》~~~火熱上市嚕!!!','<p><iframe src=\"https://www.youtube.com/embed/DTHPQrEHlPw\" width=\"880\" height=\"495\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>【幸福的微光】<br />你也許不知道，「台北市視障者家長協會」默默地關心著視<wbr />障朋友們已經22年了！一開始，只是一群求助無門的視障<wbr />者家長，他們努力想為這群在黑暗中的孩子做一點事情；<wbr />滴水穿石，每一天的努力，終於成立了協會，想幫助更多和<wbr />他們一樣的父母與視障者。他們協助視障朋友生活自理、找<wbr />工作，提供視障早療服務、視多障日間照顧，並製作視障者的教材<wbr />教具等，想為台灣所有的視障者家庭搏一點微光。<br /><br />一起閉上眼，想像一下，摸到了什麼？<br />利用小小黑點不同的排列組合，化身成「我喜歡你」、「謝謝妳」....。這似乎也可成為我們想要偷偷告白的愛情密碼❤❤❤</p>\n<p>知道嗎？如果沒有「點字」，視障者就少了一個與世界溝通的管道；在失去視覺後，觸覺和聽覺變成了最為可靠的感官，讓我們經由點字，利用觸覺，一起了解視障者的世界吧！<br /><span class=\"text_exposed_show\"><br />原價$399，現在早鳥優惠價只要350元（1本即可免運），<br />另外還有省錢團購方案，別猶豫！快點擊&lt;點點趣、都是EYE<wbr />點字桌曆網站&gt;了解、下訂吧！go！<br /><br />全台唯一的「點字桌曆」！台北市視障者家長協會需要你的<wbr />支持與幫忙，新年新希望，一起買桌曆幫助視障朋友！<br />點點趣、都是EYE點字桌曆網站：<br /><a href=\"https://www.forblind.net/ev/2018calendar-buybuy\" target=\"_blank\" rel=\"nofollow noopener\" data-lynx-mode=\"async\" data-lynx-uri=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fwww.forblind.net%2Fev%2F2018calendar-buybuy&amp;h=ATPMuP2-b0_HR2idtegIDkLAAGl4d5O9cXzmmKukqO5Szoh5JlH1eFBW841-PLKs2Q9-mLTWMrmSa0Kxry-TyFMAhjK86aPEPKdtkLyIBr63chnc7dWlA2PBgngA6hURKXF1Glt0twLQ1UXZnCJYriFhDsYr6lcIlUBPH8s3CkRfqQeV7W12vDG55axzOLMiWpBAB2zUa3c30aEB4admZ9jJ6gUIf7jJZy-r3baKeCKdgx9LSu8\">https://www.forblind.net/<wbr />ev/2018calendar-buybuy</a></span></p>','2017-11-03','志工快訊'),(7,'服務時數申請與計算懶人包','<p>各位志工夥伴們大家好</p>\n<p>有關服務時數的申請和計算方式，可能還有些老朋友和新朋友不是很清楚，所以在此一次說明：</p>\n<p>一、服務時數的計算方式是必須在<span style=\"color: #0000ff;\"><strong>五天內</strong><strong>完成所領取的</strong><strong>1份校對文件</strong><strong>（50頁）</strong></span>，才能夠將累積的服務時數歸入帳戶。</p>\n<p>二、<span style=\"color: #0000ff;\"><strong>超過五天未進行校對</strong></span>，則文件將由系統自動收回，<strong><span style=\"color: #0000ff;\">服務時數便無法累積在帳戶中</span></strong>。</p>\n<p>三、停留在頁面的時數不等於是校對服務時數，系統將會依照操作行為自行判斷是否在進行校對工作。</p>\n<p>四、服務時數採取《<span style=\"color: #0000ff;\"><strong>分鐘</strong></span>》計算，意即600（分鐘）等於10小時。<strong>（</strong>＊<strong>目前累計總時數，如未滿一小時，但超過三十分鐘者，將以一小時計算）</strong></p>\n<p>五、申請服務時數的時間是從<span style=\"color: #0000ff;\"><strong>每個月1號起</strong></span>，開放上一個月份的服務時數申請。例如：十月份的服務時數，十一月一日開始可提出申請。</p>\n<p>六、服務時數申請可從 帳號 &gt;&gt; 服務時數 進到頁面清單，再選擇兌換中心為台北市視障者家長協會後，點擊兌換即可。</p>\n<p>七、線上服務志工一律提供<span style=\"color: #0000ff;\"><strong>彩色版服務時數證明電子檔</strong></span>，已蓋有本會印章、月份、服務時數等資料。如有特殊需求請來信或來電洽詢。</p>\n<p>八、若時數累計有疑義，或是有其他申請上的相關問題（如：希望當月取得時數證明&hellip;等），請來信或來電詢問，我們會盡可能提供協助。</p>\n<p>最後感謝所有志工們的付出，也歡迎你們向親朋好友、學弟學妹、同事部屬，多多宣傳雲端千眼閱讀平台，讓我們來一起捍衛視障者平等的閱讀權益。</p>\n<p>&nbsp;</p>\n<p>雲端千眼閱讀平台</p>','2017-11-09','志工快訊'),(8,'『感謝有你．Eye在一起』感恩活動','<p>點字桌曆大贈送</p>\n<p>雲端千眼平台正式運作即將要滿一年了！為了表達滿滿的感謝心意，我們將送出五本全台獨家－2018年點字桌曆做為答謝，活動方式如下：</p>\n<p>於&nbsp;<a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/2017%E5%B9%B412%E6%9C%8815%E6%97%A5%E5%89%8D?source=feed_text&amp;story_id=1508834629154015\" data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\" aria-label=\"主題標籤\">#</span><span class=\"_58cm\">2017年12月15日前</span></span></a>&nbsp;至雲端千眼平台加入校對志工行列，並完成志工校對服務時數累計滿8小時/480分鐘以上（限定12月份），截圖PO文至本會臉書活動貼文下方（<a href=\"https://www.facebook.com/forblind/\">協會臉書官方頁</a>），並標記@兩位好朋友留言「做志工．好有Eye；點點趣．真精采」，我們將隨機抽出五名送出價值399元的2018年「點點趣．都是EYE」點字桌曆。（將在12/18公佈得獎名單）</p>\n<div class=\"text_exposed_show\">\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E5%B0%8F%E8%81%B2%E8%AA%AA%E5%8F%83%E5%8A%A0%E6%B4%BB%E5%8B%95%E9%82%84%E6%98%AF%E6%9C%89%E6%9C%8D%E5%8B%99%E6%99%82%E6%95%B8%E8%AD%89%E6%98%8E%E6%BB%B4?source=feed_text&amp;story_id=1508834629154015\" data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\" aria-label=\"主題標籤\">#</span><span class=\"_58cm\">小聲說參加活動還是有服務時數證明滴</span></span></a><br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E6%9C%8D%E5%8B%99%E6%99%82%E6%95%B8%E6%9B%B4%E6%96%B0%E9%9C%80%E8%A6%81%E4%B8%80%E5%A4%A9%E8%AB%8B%E7%9B%A1%E5%BF%AB%E5%AE%8C%E6%88%908%E5%B0%8F%E6%99%82%E7%9A%84%E6%A0%A1%E5%B0%8D%E6%89%8D%E4%BE%86%E7%9A%84%E5%8F%8A%E5%93%A6?source=feed_text&amp;story_id=1508834629154015\" data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\" aria-label=\"主題標籤\">#</span><span class=\"_58cm\">服務時數更新需要一天請盡快完成8小時的校對才來的及哦</span></span></a><br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E5%85%A8%E5%8F%B0%E7%8D%A8%E5%AE%B6%E9%BB%9E%E5%AD%97%E6%A1%8C%E6%9B%86%E6%95%99%E4%BD%A0%E5%A6%82%E4%BD%95%E5%B0%87%E5%BF%83%E6%84%8F%E8%97%8F%E5%9C%A8%E9%BB%9E%E5%AD%97%E8%A3%A1?source=feed_text&amp;story_id=1508834629154015\" data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\" aria-label=\"主題標籤\">#</span><span class=\"_58cm\">全台獨家點字桌曆教你如何將心意藏在點字裡</span></span></a><br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E7%B5%95%E5%B0%8D%E4%B8%8D%E6%9C%83%E8%B7%9F%E4%BD%A0%E5%80%91%E8%AA%AA%E9%9B%B2%E7%AB%AF%E5%8D%83%E7%9C%BC%E7%B6%B2%E5%9D%80%E9%80%A3%E7%B5%90%E6%98%AF?source=feed_text&amp;story_id=1508834629154015\" data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\" aria-label=\"主題標籤\">#</span><span class=\"_58cm\">絕對不會跟你們說雲端千眼網址連結是</span></span></a><br /><a href=\"http://www.edocumentservice.org/\" target=\"_blank\" rel=\"noopener nofollow\" data-ft=\"{&quot;tn&quot;:&quot;-U&quot;}\" data-lynx-mode=\"async\" data-lynx-uri=\"https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.edocumentservice.org%2F&amp;h=ATPdTH3KbNHcqYtetESCEWegNdeTlOYZWUEr2wkTkhSIB2UDNPZcm24ZHUTkPTINE3GmRUvJMAaNLq_PUiqsMcMGtedRyYmw0a50ILdEMfHoBv4hWFQEK9MtSQm8GJDiVcZZyzhaArfC1L9GeqSER1zNWePegmGX6CPlgDocaYUor00upW2bQEgHHQUWhKXKlriI_u2SBxHMZgnFK49aEggeQYI-hxPBX4wo8sNe8wbOpnCXdDpKFCtfZslLXQ1ioy2fTlNMaa1Vx0JeuhFJj7lX8QQUXREFIg6OF4wo\">www.edocumentservice.org</a></p>\n<div>\n<div class=\"mcafee_UNKNOWN\">--</div>\n<div id=\"{0DE9E47C-871A-4F90-8440-B190C216800A}_16\" class=\"mcafee_UNKNOWN\">還不知道2018【點點趣、都是EYE】點字桌曆是甚麼嗎?!?!</div>\n</div>\n<p>&gt;&gt;&gt;影片：<a href=\"https://youtu.be/DTHPQrEHlPw\" target=\"_blank\" rel=\"noopener nofollow\" data-ft=\"{&quot;tn&quot;:&quot;-U&quot;}\" data-lynx-mode=\"async\" data-lynx-uri=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fyoutu.be%2FDTHPQrEHlPw&amp;h=ATN5d8mVk2N8AI1pYYpitARrn_YGQlHNS1-j3IIa9le6BQQaSUKojmyl8GE8fFBKin0vk000TmBl2Axz3wm8dK4kb3oMqxA2cFMyr7KGI0NzU29tB6zhe92X5_mI4E_fwWpdngRvvbBXECg37qdV5lH823eWngaISC5nE4R7sq1y6WodOxQwPFnucPB81JXRK4RL_DoSMTij5BIbwyaJtD7b7m7p28jfMOOzicE7eRpsVnGQOWEXkXKrW0rCXglvybGeexs578JldP5DdXOVqvlhyobumlKIR3WN_LS-\">https://youtu.be/DTHPQrEHlPw</a></p>\n<div>\n<div id=\"{0DE9E47C-871A-4F90-8440-B190C216800A}_15\" class=\"mcafee_OK\">&gt;&gt;&gt;購買網址：<a href=\"https://www.forblind.net/ev/2018calendar-buybuy\" target=\"_blank\" rel=\"noopener nofollow\" data-ft=\"{&quot;tn&quot;:&quot;-U&quot;}\" data-lynx-mode=\"async\" data-lynx-uri=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fwww.forblind.net%2Fev%2F2018calendar-buybuy&amp;h=ATN3pbS4VTuJlw2J3vxETD3nTZClSmRjQVR78N5seSWowg1dqoGWlUh9h9KdqiPyCsbM4yRpf1TLiM5Jei7eQCNyqOiMrHy-K4uWU3m2QnVHsBRHQCUEjZv6MrOF6bg3br4zLLMIGe2HK_RvoxEjMV_tNOSxBqoSeMgVvERQOiyvrbx1l8BFn_WeQgslx4sgNKjDMIu6bwaCtc0aPd6dY_aqAJdYVCyBHIdeMcLrDaLsOwVzbMPm_piMgrA_wTDGMaCgshLuftcXeJMCUVCpBd3M5paefkIQHFfSSI5v\">https://www.forblind.net/ev/2018calendar-buybuy</a></div>\n</div>\n</div>\n<p>&nbsp;</p>','2017-11-30','平台消息'),(9,'聆聽視障者的音樂色彩~~音樂會邀請函','<p>大家好~</p>\n<p>邀請各位雲端千眼志工夥伴來參與一場音樂饗宴哦~~<br />表演者都是視障者呢！<br /><br /><span style=\"color: #0000ff;\"><strong>※《本活動有部份需要協助事宜，可提供1小時志願服務時數證明，<wbr />亦可純粹參與音樂會》※</strong></span></p>\n<p>&nbsp;</p>\n<p><img src=\"https://i.imgur.com/Q8q80ss.png\" alt=\"2017幻化觸摸點字之美 音樂會邀請函\" width=\"250\" height=\"366\" /></p>\n<p>音樂喜事，誠摯的邀請大家一同參與~<img src=\"../static/ebookSystem/framework/tinymce-4.7.4/js/tinymce/plugins/emoticons/img/smiley-wink.gif\" alt=\"wink\" /><br />(((點字樂譜成果發表會)))<br /><br />***幻化觸摸點字的美***<br />聲樂表演&mdash;桑塔露琪婭（世界民曲）表演者:江尉綺<br />流行歌曲 表演者:周建宇、張雅恩<br />EYE鼓動 表演者:劉子瑜、江尉綺、林昊恩<br /><br />日期：2017.12.20(三)下午2:00到4:00<br />地點：啟明分館4樓音樂廳舉辦音樂會<br />（台北市敦化北路155巷76號4樓)<br /><br /><strong><span style=\"color: #0000ff;\">有意參加者，請於16日前MAIL至<a style=\"color: #0000ff;\" href=\"mailto:a9203045@forblind.org.tw\">a9203045@<wbr />forblind.org.tw</a>向周先生登記（註明姓名及人數），</span></strong><br /><strong><span style=\"color: #0000ff;\">或是直接電洽：2717-7722#20 周先生</span></strong><br /><br />#幻化觸摸點字的美<br />#點字樂譜成果發表會<br />#EYE鼓動</p>\n<p>&nbsp;</p>','2017-12-13','志工快訊');
